import React from 'react';
import Tribe from './assets/Tribe.png'
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';
import Link from '@mui/material/Link';
// import Assignment1 from './Assignment1';
import Typography from '@mui/material/Typography';
import {ReactComponent as Hello} from './assets/Hello.svg'
import Hidden from '@mui/material/Hidden';


const Index = () => {
  return( 
    <>   
        <Grid container sm={12} padding={5} justifyContent='space-between'>
            <Grid item sm={4} xs={6}>
                <img src={Tribe} alt='tribe' />
            </Grid>
            <Grid item sm={4} xs={6} container justifyContent='flex-end'>
                <Button variant='outlined' size='medium' sx={{color: 'white', background: '#00004d'}}>Register</Button>
            </Grid>
            <Grid container sm={6}> 
                <Hello style={{width: '100%', minHeight: 350}} />
            </Grid>
            <Grid container sm={6}> 
                <Grid container style={{color: '#00004d', lineHeight: 'normal', marginTop: 40}}>
                    <Typography variant='h1' style={{textAlign: 'center'}}>Hello! ðŸ‘‹ðŸ‘‹</Typography>
                    <Hidden smDown>
                        <Typography variant='h3'>Shivam Damre here... Full Stack Developer</Typography>
                        <Typography variant='h5'>This is a Assignment given by Invest With Tribe. Pls, do check. You can follow me on linkedin <Link href='https://www.linkedin.com/in/shivam-damre-b84538170/'>Linkedin</Link></Typography>
                        
                        {/* <Typography variant='h5'>Pls do check and you can follow me on linkedin</Typography> */}
                    </Hidden>
                </Grid>
            </Grid>
        </Grid>
    </>
    )
};

export default Index;
